import React from 'react'
import Navbar from '../Bar/NavBar';
import { Outlet} from 'react-router-dom'
import { Container } from '@mui/material';
const Rootlayout = () => {
    return (
        <>
            <Navbar />
            <Container sx={{ p: 5 }}>
                <Outlet />
            </Container>
        </>
    );
}

export default Rootlayout;
